import { BrowserRouter as Router, Route, Routes } from 'react-router';
import "./App.css";
import Home from "./Pages/Home";


function App() {
  return (
    <Router>


      <Routes>
      <Route path ="/" element = {<Home/>}></Route>


      </Routes>


    </Router>
  );
}
export default App;
